INSERT INTO `donvi` (`id`, `ten_donvi`, `loai_dv_id`, `dvcc`, `lvhd`, `lhcsgd`, `ten_ngan`, `ma_donvi`, `dia_chi`, `mo_ta`, `truong_dv`, `canbo_dbcl`, `nguoi_tao`, `csdt_id`, `trang_thai`, `created_at`, `updated_at`, `deleted_at`, `ten_tienganh`, `ten_donvi_cu`, `ten_ctdt`, `ten_ctdt_tienganh`, `ten_ctdt_cu`, `ma_ctdt`, `dien_thoai`, `email`, `website`, `nam_thanhlap`, `nam_batdau`, `nam_capbang`, `mota_nam_thanhlap`, `gioi_thieu`, `co_cau_tochuc`) VALUES
(5, 'Khoa Cơ khí', 1, NULL, NULL, NULL, 'CK', '1005', 'Tầng 3 - Nhà A10 - CS1', 'Hội trường B1', 2839, 0, 0, 1, 'active', NULL, '2021-10-01 08:58:20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Website: https://fme.haui.edu.vn', '2005', '2006', '2010', '<p><span lang=\"NL\" style=\"font-size: 13pt; line-height: 107%; font-family: &quot;Times New Roman&quot;, serif;\">Quyết định số 2033/QĐ-ĐHCN, ngày 22 tháng 12 năm\n2005 của Hiệu trưởng Trường ĐHCN Hà Nội</span><br></p>', '<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-indent:27.35pt;\nline-height:150%\"><span lang=\"PT-BR\" style=\"font-size:13.0pt;line-height:150%;\nmso-fareast-font-family:Calibri;mso-ansi-language:PT-BR\">Khoa Cơ khí trường Đại\nhọc Công nghiệp Hà Nội được thành lập theo Quyết định số 2033/QĐ-ĐHCN, ngày 22\ntháng 12 năm 2005 của Hiệu trưởng trường Đại học Công nghiệp Hà Nội trên cơ sở\nnâng cấp từ khoa Cơ khí trường cao đẳng Công nghiệp Hà Nội.</span><span lang=\"VI\" style=\"font-size:13.0pt;line-height:150%\"> Lịch sử Khoa cơ khí gắn với\nlịch sử Nhà trường, với truyền thống 123 năm xây dựng và phát triển, Khoa cơ\nkhí đã đào tạo và cung cấp cho xã hội nhiều cán bộ, thạc sĩ, kỹ sư, cử nhân có\ntrình độ chuyên môn cao, có kỹ năng tốt đáp ứng được các yêu cầu của thực tế.<o:p></o:p></span></p><p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-indent:27.35pt;\nline-height:150%\"><span lang=\"VI\" style=\"font-size: 13pt; line-height: 150%;\">Hiện </span><span style=\"font-size: 13pt; line-height: 150%;\">nay</span><span lang=\"VI\" style=\"font-size: 13pt; line-height: 150%;\">, đội ngũ cán bộ viên chức Khoa cơ khí có\ntổng số 72 người, trong đó đội ngũ giảng dạy 67 người (chiếm 93%), PGS và Tiến\nsĩ 28 người (chiếm 41,8%)</span><span style=\"font-size: 13pt; line-height: 150%;\">. </span><span lang=\"VI\" style=\"font-size: 13pt; line-height: 150%;\">Tính từ năm 2016 đến 2020, đội ngũ giảng\nviên trình độ Tiến sĩ trở lên tăng 14 người lên 28 người. </span><span lang=\"VI\" style=\"font-size:13.0pt;line-height:150%\">Các cán bộ, giảng viên trong Khoa đều\ncó chuyên môn tốt, có khả năng nghiên cứu khoa học, viết các bài báo khoa học\nvà thực hiện các đề tài, dự án…<o:p></o:p></span></p><p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-indent:1.0cm;\nline-height:150%\"><span lang=\"VI\" style=\"font-size:13.0pt;line-height:150%\">Hiện\nnay, Khoa Cơ khí đang quản lý và đào tạo gần 5000 nghiên cứu sinh, học viên,\nsinh viên ở 4 cấp trình độ, bao gồm: 01 ngành trình độ Tiến sĩ: Kỹ thuật Cơ\nkhí; 02 ngành trình độ Thạc sĩ: Kỹ thuật cơ khí và Kỹ thuật Cơ điện tử; 05\nngành trình độ Đại học: Công nghệ kỹ thuật cơ khí, Công nghệ kỹ thuật Cơ điện\ntử, Công nghệ kỹ thuật khuôn mẫu, Robot và Trí tuệ nhân tạo và Kỹ thuật hệ\nthống Công nghiệp, 01 ngành đào tạo Cao đẳng. Chất\nlượng đào tạo các ngành của Khoa đáp ứng tốt nhu cầu của thị trường lao động,\ntỉ lệ sinh viên có việc làm sau 1 năm tốt nghiệp </span><span style=\"font-size: 13pt; line-height: 150%;\">trung\nbình</span><span lang=\"VI\" style=\"font-size: 13pt; line-height: 150%;\">\nđạt trên 9</span><span style=\"font-size: 13pt; line-height: 150%;\">0</span><span lang=\"VI\" style=\"font-size: 13pt; line-height: 150%;\">%</span><span style=\"font-size: 13pt; line-height: 150%;\">.<o:p></o:p></span></p><p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;text-indent:1.0cm;\nline-height:150%\"><span lang=\"VI\" style=\"font-size:13.0pt;line-height:150%\">Khoa\nCơ khí hiện đang quản lý 25 phòng thực hành/thí nghiệm hiện đại, được trang bị\nnhiều thiết bị công nghệ cao phục vụ đào tạo, nghiên cứu khoa học và chuyển\ngiao công nghệ</span><span style=\"font-size:13.0pt;line-height:150%;mso-ansi-language:\nEN-US\">. </span><span lang=\"VI\" style=\"font-size:13.0pt;line-height:150%\">Hàng\nnăm, Khoa tiếp tục được Nhà trường xây dựng 1 đến 2 phòng thực hành thí nghiệm,\nđầu tư bổ sung nhiều trang thiết bị hiện đại phục vụ đào tạo và nghiên cứu..<o:p></o:p></span></p><p class=\"pbody\" style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 1cm; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:\n13.0pt;line-height:150%\">Khoa Cơ khí có bề dày truyền thống trong đào tạo và\nnghiên cứu khoa học, luôn hoàn thành xuất sắc nhiệm vụ năm học. Nhiều năm liên\ntiếp, khoa đạt danh hiệu tập thể lao động xuất sắc, được tặng nhiều Bằng khen\ncác cấp Bộ, Ngành. Đặc biệt, năm 2008 Tập thể khoa được tặng Bằng khen của Thủ\nTướng Chính phủ và năm 2013 khoa được Tặng Huận Chương lao động hạng ba của Chủ\ntịch Nước.<o:p></o:p></span></p><p class=\"pbody\" style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 1cm; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:\n13.0pt;line-height:150%\">&nbsp;&nbsp; Khoa cơ khí là\nmột trong những khoa đi đầu trong các phong trào thi đua dạy tốt, học tốt, tích\ncực nghiên cứu khoa học và chuyển giao công nghệ: <o:p></o:p></span></p><p class=\"pbody\" style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 1cm; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:\n13.0pt;line-height:150%\">- Nhiều thế hệ giáo viên đã được phong tặng danh hiệu\ncao quý Nhà giáo Nhân dân, Nhà Giáo ưu tú và đạt các thành tích cao trong hội\nthi giáo viên dạy giỏi các cấp...<o:p></o:p></span></p><p class=\"pbody\" style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; text-indent: 1cm; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:\n13.0pt;line-height:150%\">- Cán bộ giảng viên trong Khoa đã thực hiện gần 60 đề\ntài nghiên cứu khoa học các cấp, trong đó có 07 đề tài cấp nhà nước, 10 đề tài\ncấp bộ/cấp tỉnh, 40 đề tài cấp Trường. biên soạn và\nxuất bản hơn 20 giáo trình, tài liệu phục vụ đào tạo. Hướng dẫn sinh viên thực\nhiện 158 đề tài cấp trường, đạt 01 giải nhất, 02 giải ba, 01 giải khuyến khích\ncấp Bộ; đạt 14 giải nhất, 23 giải nhì, 28 giải ba cấp Trường, công bố trên 500\nbài báo khoa học trên các tạp chí uy tín trong và ngoài nước, trong đó trên 200\nbài công bố quốc tế (30 bài Q1, 33 bài Q2, 55 bài Q3, 29 bài Q4). Ngoài\nra, Khoa Cơ khí còn luôn thực hiện hoạt động chuyển giao công nghệ, phối hợp\ncác đơn vị trong và ngoài trường thực hiện các đề tài, dự án … <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-indent:36.0pt;line-height:150%\"><span style=\"font-size: 13pt; line-height: 150%; font-family: &quot;Times New Roman&quot;, serif;\">- Sinh viên Khoa cơ khí\ndành nhiều thành tích cao trong các hội thi: Hội thi tay nghề vẽ và thiết kế\ntrên máy tính đạt 02 chứng chỉ nghề xuất sắc Thế giới, 03 Huy chương vàng, 01\nHuy chương đồng, 04 chứng chỉ nghề xuất sắc ASEAN, 14 Giải nhất, 05 Giải nhì,\n07 Giải ba cấp Quốc gia, 07 Chứng chỉ nghề xuất sắc cấp Quốc gia; 18 giải Nhất,\n15 giải Nhì, 06 giải Ba, 03 chứng chỉ nghề xuất sắc cấp Bộ/Thành phố. Hội thi\nOlympic Cơ học toàn quốc đạt 08 giải Nhất, 19 giải Nhì, 35 giải Ba, 138 giải\nKhuyến khích, đạt nhiều giải Nhất, Nhì, Ba cấp trường; Hội thi Robocon đạt 01\ngiải Nhất, 01 giải Nhì, 01 giải Ba và nhiều đội được vào vòng chung kết Robocon\nvà Robocon Techshow...<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-indent:1.0cm;line-height:150%;background:#FEFEFE\"><b><span style=\"font-size:13.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US\">* Những phần\nthưởng cao quý:</span></b><span style=\"font-size:13.0pt;line-height:150%;\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-ansi-language:EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-indent:1.0cm;line-height:150%;background:#FEFEFE\"><span style=\"font-size:13.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US\">- 01 Huân\nchương lao động hạng ba;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-indent:1.0cm;line-height:150%;background:#FEFEFE\"><span style=\"font-size:13.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US\">- 01 Bằng\nkhen của Thủ tướng Chính phủ;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-indent:1.0cm;line-height:150%;background:#FEFEFE\"><span style=\"font-size:13.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US\">- 05 Bằng\nkhen của Bộ Trưởng Bộ Công Thương;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-indent:1.0cm;line-height:150%;background:#FEFEFE\"><span style=\"font-size:13.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US\">- 01 Bằng\nkhen của Tổng LĐLĐ Việt Nam;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-indent:1.0cm;line-height:150%;background:#FEFEFE\"><span style=\"font-size:13.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US\">- 04 Bằng\nkhen của Công đoàn Công Thương Việt Nam;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-indent:1.0cm;line-height:150%;background:#FEFEFE\"><span style=\"font-size:13.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US\">- Nhiều Giấy\nkhen của các Sở/Ngành và BCH Đảng bộ Trường ĐHCNHN;<o:p></o:p></span></p><p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;text-align:\njustify;text-indent:1.0cm;line-height:150%;background:#FEFEFE\"><span style=\"font-size:13.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US\">- Nhiều cá\nnhân được phong tặng danh hiệu NGND, NGƯT, Huân chương lao động hạng nhì, ba,\nđược tặng Bằng khen của Thủ tướng chính phủ và các Bộ/Ngành…<o:p></o:p></span></p>', '<p class=\"MsoNormal\" style=\"margin-bottom:10.0pt;line-height:150%\"><b><i><span lang=\"PT-BR\" style=\"font-size: 13pt; line-height: 150%; font-family: &quot;Times New Roman&quot;, serif;\">25.1. Cơ cấu\ntổ chức của Trường ĐHCN Hà Nội</span></i></b></p><p class=\"MsoNormal\" style=\"text-align: center; margin-bottom: 10pt; line-height: 150%;\"><img src=\"data:image/png;base64,\" style=\"width: 341px;\" data-filename=\"image.png\"><b><i><span lang=\"PT-BR\" style=\"font-size: 13pt; line-height: 150%; font-family: &quot;Times New Roman&quot;, serif;\"><br></span></i></b></p><p class=\"MsoNormal\" style=\"margin-bottom:10.0pt;line-height:150%\"><b><i><span lang=\"PT-BR\" style=\"font-size: 13pt; line-height: 150%; font-family: &quot;Times New Roman&quot;, serif;\"><o:p></o:p></span></i></b></p><p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:10.0pt;text-align:center;\nline-height:150%\"><span style=\"font-size:13.0pt;line-height:150%;font-family:\n&quot;Times New Roman&quot;,serif;mso-bidi-font-family:Arial;mso-bidi-theme-font:minor-bidi;\nmso-ansi-language:EN-US;mso-no-proof:yes\"><!--[if gte vml 1]><v:shapetype id=\"_x0000_t75\"\n coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\"\n filled=\"f\" stroked=\"f\">\n <v:stroke joinstyle=\"miter\"></v:stroke>\n <v:formulas>\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"></v:f>\n  <v:f eqn=\"sum @0 1 0\"></v:f>\n  <v:f eqn=\"sum 0 0 @1\"></v:f>\n  <v:f eqn=\"prod @2 1 2\"></v:f>\n  <v:f eqn=\"prod @3 21600 pixelWidth\"></v:f>\n  <v:f eqn=\"prod @3 21600 pixelHeight\"></v:f>\n  <v:f eqn=\"sum @0 0 1\"></v:f>\n  <v:f eqn=\"prod @6 1 2\"></v:f>\n  <v:f eqn=\"prod @7 21600 pixelWidth\"></v:f>\n  <v:f eqn=\"sum @8 21600 0\"></v:f>\n  <v:f eqn=\"prod @7 21600 pixelHeight\"></v:f>\n  <v:f eqn=\"sum @10 21600 0\"></v:f>\n </v:formulas>\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"></v:path>\n <o:lock v:ext=\"edit\" aspectratio=\"t\"></o:lock>\n</v:shapetype><v:shape id=\"Picture_x0020_9\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\"\n style=\'width:255.75pt;height:329.25pt;visibility:visible;mso-wrap-style:square\'>\n <v:imagedata src=\"file:///C:\\Users\\TRINHT~1\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png\"\n  o:title=\"\"></v:imagedata>\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--></span><b><i><span lang=\"PT-BR\" style=\"font-size: 13pt; line-height: 150%; font-family: &quot;Times New Roman&quot;, serif;\"><o:p></o:p></span></i></b></p><p class=\"MsoNormal\" style=\"text-align: center; margin-bottom: 10pt; line-height: 150%;\">\n\n\n\n</p><p class=\"MsoNormal\" style=\"margin-bottom:10.0pt;line-height:150%\"><b><i><span lang=\"PT-BR\" style=\"font-size: 13pt; line-height: 150%; font-family: &quot;Times New Roman&quot;, serif;\">25.2. Cơ cấu\ntổ chức của </span></i></b><b><i><span style=\"font-size: 13pt; line-height: 150%; font-family: &quot;Times New Roman&quot;, serif;\">Khoa Cơ khí</span></i></b></p><p class=\"MsoNormal\" style=\"text-align: center; margin-bottom: 10pt; line-height: 150%;\"><img src=\"data:image/png;base64,\" style=\"width: 299px;\" data-filename=\"image.png\"><b><i><span style=\"font-size: 13pt; line-height: 150%; font-family: &quot;Times New Roman&quot;, serif;\"><br></span></i></b><b><i><span style=\"font-size: 13pt; line-height: 150%; font-family: &quot;Times New Roman&quot;, serif;\"> <span lang=\"PT-BR\"><o:p></o:p></span></span></i></b></p><p style=\"text-align: center; \">\n\n\n\n\n\n</p><p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:10.0pt;text-align:center;\nline-height:150%\"><span style=\"font-size: 13pt; line-height: 150%;\"><!--[if gte vml 1]><v:shape id=\"Picture_x0020_8\" o:spid=\"_x0000_i1025\"\n type=\"#_x0000_t75\" style=\'width:224.25pt;height:262.5pt;visibility:visible;\n mso-wrap-style:square\'>\n <v:imagedata src=\"file:///C:\\Users\\TRINHT~1\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image003.jpg\"\n  o:title=\"\"></v:imagedata>\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--></span><span lang=\"PT-BR\" style=\"font-size: 13pt; line-height: 150%; font-family: &quot;Times New Roman&quot;, serif;\"><o:p></o:p></span></p>');
INSERT INTO `donvi` (`id`, `ten_donvi`, `loai_dv_id`, `dvcc`, `lvhd`, `lhcsgd`, `ten_ngan`, `ma_donvi`, `dia_chi`, `mo_ta`, `truong_dv`, `canbo_dbcl`, `nguoi_tao`, `csdt_id`, `trang_thai`, `created_at`, `updated_at`, `deleted_at`, `ten_tienganh`, `ten_donvi_cu`, `ten_ctdt`, `ten_ctdt_tienganh`, `ten_ctdt_cu`, `ma_ctdt`, `dien_thoai`, `email`, `website`, `nam_thanhlap`, `nam_batdau`, `nam_capbang`, `mota_nam_thanhlap`, `gioi_thieu`, `co_cau_tochuc`) VALUES
(6, 'Khoa Công nghệ Hóa', 1, NULL, NULL, NULL, 'CN Hóa', '1006', 'Nhà B2, Khoa Công nghệ Hóa, Cơ sở 2, Trường ĐHCNHN.', 'Hội trường B3', 2957, 2977, 0, 1, 'active', '2021-03-22 07:20:40', '2021-03-22 07:20:40', NULL, 'Faculty of Chemical Technology', 'Khoa Công nghệ Hóa học', 'Ngành CNKT Hóa học', 'Chemical Engineering ', 'Không có', 'DH5104011', '+842437655121 ', NULL, 'http: //fct.haui.edu.vn', '2003', '2006', '2010', NULL, '<p>&nbsp; &nbsp; Khoa công nghệ Hóa trước đây có tên là Khoa Công nghệ Hóa Công nghiệp được thành lập ngày 01/03/2003 theo Quyết định số 171/QĐ/TCHC của Hiệu trưởng trường Cao đẳng Công nghiệp Hà Nội. Ngày 22/12/2005, theo Quyết định số 2029/QĐ- ĐHCN, Khoa\n    đổi tên thành Khoa công nghệ Hóa sau khi Nhà trường nâng cấp thành Trường ĐH.</p>\n\n<p>&nbsp; &nbsp; &nbsp;Cơ cấu tổ chức: Hội đồng Khoa, Trưởng khoa, 02 phó trưởng Khoa, 06 BM, 1 phòng trực thuộc Khoa.</p>\n\n<p>&nbsp; &nbsp; &nbsp;Tổng số CB viên chức của Khoa là 40, trong đó có 04 PGS, 22 TS, 04 NCS, 08 ThS, 02 chuyên viên.</p>\n\n<p>&nbsp; &nbsp; &nbsp; Ngày 27/10/2005, ba BM Hóa cơ sở, Công nghệ hóa học, Kỹ thuật PTN được thành lập theo quyết định số 1585/QĐ-CĐCN. Ngày 14/11/2014 các BM Công nghệ hóa học và Kỹ thuật PTN được giải thể và thành lập các BM mới: Công nghệ Hóa hữu cơ,\n    Công nghệ Hóa vô cơ-Hóa công, Công nghệ Hóa phân tích, Công nghệ Hóa dầu, Công nghệ Môi trường và tổ Kỹ thuật PTN (đã sát nhập vào Tổ hành chính tháng 07/2018). Tháng 07/2020, Khoa CN Hóa thành lập thêm PTN phân tích và ứng dụng.</p>\n\n<p>&nbsp; &nbsp; &nbsp;Ngày 03/7/2013 theo quyết định số 2424/QĐ-BGDĐT của Bộ trưởng BGD&amp;ĐT Khoa được phép đào tạo trình độ ThS chuyên ngành Kỹ thuật Hóa học, từ tháng 7/2017 Khoa mở đào tạo TS Kỹ thuật Hóa học. Hiện nay Khoa có 3 cấp độ đào tạo: TS,\n    ThS, ĐH.</p>\n<p><br></p>', '<p style=\"text-align: center;\"><img src=\"data:image/png;base64,\"\n        alt=\"\" style=\"font-size: 0.9375rem;\"></p>\n<p><br></p>\n<p style=\"text-align: center;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <i>Hình\n1. Sơ đồ cơ cấu tổ chức của Trường ĐHCNHN</i></p><br><br>\n<p style=\"text-align: center;\"><img src=\"data:image/png;base64,\"\n        alt=\"\"><br></p>\n<p>\n</p>\n<p style=\"text-align: center;\"><i>Hình 2. Sơ đồ tổ chức của Khoa Công\nnghệ Hóa</i></p><br>\n<p></p>');
INSERT INTO `donvi` (`id`, `ten_donvi`, `loai_dv_id`, `dvcc`, `lvhd`, `lhcsgd`, `ten_ngan`, `ma_donvi`, `dia_chi`, `mo_ta`, `truong_dv`, `canbo_dbcl`, `nguoi_tao`, `csdt_id`, `trang_thai`, `created_at`, `updated_at`, `deleted_at`, `ten_tienganh`, `ten_donvi_cu`, `ten_ctdt`, `ten_ctdt_tienganh`, `ten_ctdt_cu`, `ma_ctdt`, `dien_thoai`, `email`, `website`, `nam_thanhlap`, `nam_batdau`, `nam_capbang`, `mota_nam_thanhlap`, `gioi_thieu`, `co_cau_tochuc`) VALUES
(7, 'Khoa Công nghệ May - TKTT', 1, NULL, NULL, NULL, 'CN M&TT', '1007', 'Tầng 2 - Nhà B4 - CS2', '', 3011, 0, 0, 1, 'active', NULL, '2021-10-05 07:51:25', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://fgd.haui.edu.vn/vn', '2005', '2005', '2009', '<p><span style=\"font-size:13.0pt;line-height:107%;\nfont-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\nmso-ansi-language:EN-US;mso-fareast-language:ZH-CN;mso-bidi-language:AR-SA\">Thành\nlập năm 2005 theo Quyết định số 2028/QĐ-ĐHCN</span><br></p>', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 28.1pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;line-height:150%;font-family:\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\nEN-US\">Khoa Công nghệ may và Thiết kế thời trang (CNM&amp;TKTT) được thành lập\ntheo Quyết định&nbsp;số 2028/QĐ-ĐHCN ngày 22 tháng 12 năm 2005&nbsp;của Hiệu\ntrưởng Trường ĐHCNHN. Khoa CNM&amp;TKTT có chức năng thực hiện đào tạo các cấp\ntrình độ (cao đẳng, đại học và thạc sĩ), nghiên cứu khoa học, chuyển giao công\nnghệ thuộc lĩnh vực Công nghệ dệt may, thiết kế thời trang và công nghệ vật\nliệu dệt may;&nbsp;thực hiện các chức năng khác theo quy định của pháp luật và\nQuy chế tổ chức, hoạt động của Nhà trường.&nbsp;Phát huy truyền thống và danh\nhiệu anh hùng lao động thời kỳ đổi mới của Nhà trường, Khoa CNM&amp;TKTT cũng\nkhông ngừng đổi mới, phát triển và lớn mạnh. Hiện nay Khoa đã có một đội ngũ\ngiảng viên với kiến thức và trình độ tay nghề cao; có hệ thống các phòng thực\nhành thí nghiệm từ cơ bản đến hiện đại đạt tiêu chuẩn, xứng tầm với các trường\nđại học ở trong nước và khu vực.<o:p></o:p></span></p><p>\n\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 1cm; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.0pt;line-height:150%;font-family:\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\nEN-US\">Cũng như các Khoa khác trong Trường, cán bộ giảng viên và sinh viên Khoa\nCNM&amp;TKTT được làm việc trong một môi trường năng động, sáng tạo với những\nphương pháp giảng dạy, học tập, quản lý chuyên nghiệp, kỷ cương, hiện đại nhưng\nđầy tính nhân văn. Đó là lý do ngày càng có nhiều người học ưu tú hơn lựa chọn\nKhoa CNM&amp;TKTT là nơi ươm mầm cho những ước mơ, để học tập và trưởng thành.\nChính vì những lẽ đó mà số lượng sinh viên hàng năm lựa chọn Khoa CNM&amp;TKTT\nđể học tập không ngừng ổn định và gia tăng chất lượng.</span><span style=\"font-size:13.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p>', '<p><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 13pt; text-align: center;\">&nbsp; <b>&nbsp;CƠ CẤU TỔ CHỨC TRƯỜNG ĐHCNHN</b></span></p><p><img src=\"data:image/png;base64,\" style=\"width: 451px;\" data-filename=\"image.png\"><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 13pt; text-align: center;\"><b><br></b></span><img src=\"data:image/png;base64,\" style=\"width: 451px;\" data-filename=\"image.png\"><br></p>');
INSERT INTO `donvi` (`id`, `ten_donvi`, `loai_dv_id`, `dvcc`, `lvhd`, `lhcsgd`, `ten_ngan`, `ma_donvi`, `dia_chi`, `mo_ta`, `truong_dv`, `canbo_dbcl`, `nguoi_tao`, `csdt_id`, `trang_thai`, `created_at`, `updated_at`, `deleted_at`, `ten_tienganh`, `ten_donvi_cu`, `ten_ctdt`, `ten_ctdt_tienganh`, `ten_ctdt_cu`, `ma_ctdt`, `dien_thoai`, `email`, `website`, `nam_thanhlap`, `nam_batdau`, `nam_capbang`, `mota_nam_thanhlap`, `gioi_thieu`, `co_cau_tochuc`) VALUES
(8, 'Khoa Công nghệ Ô tô', 1, NULL, NULL, NULL, 'CN Ôtô', '1008', 'Tầng 4 - Nhà A10 - CS1', 'Hội trường B2', 2916, 2947, 0, 1, 'active', NULL, '2021-04-20 04:36:56', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `donvi` (`id`, `ten_donvi`, `loai_dv_id`, `dvcc`, `lvhd`, `lhcsgd`, `ten_ngan`, `ma_donvi`, `dia_chi`, `mo_ta`, `truong_dv`, `canbo_dbcl`, `nguoi_tao`, `csdt_id`, `trang_thai`, `created_at`, `updated_at`, `deleted_at`, `ten_tienganh`, `ten_donvi_cu`, `ten_ctdt`, `ten_ctdt_tienganh`, `ten_ctdt_cu`, `ma_ctdt`, `dien_thoai`, `email`, `website`, `nam_thanhlap`, `nam_batdau`, `nam_capbang`, `mota_nam_thanhlap`, `gioi_thieu`, `co_cau_tochuc`) VALUES
(9, 'Khoa Công nghệ thông tin', 1, NULL, NULL, NULL, 'CNTT', '1009', 'Tầng 6, nhà A1, Trường Đại học Công nghiệp Hà Nội, 298 Đường Cầu diễn, Quận Bắc Từ liêm, TP. Hà Nội', 'Hội trường B2', 3918, 3071, 0, 1, 'active', NULL, '2020-10-05 09:48:14', NULL, 'Faculty of Information Technology', NULL, 'Công nghệ thông tin', 'Information Technology', NULL, '7480201', '0983144899', 'khoacntt@haui.edu.vn', 'fit.haui.edu.vn', '1999', '2015', '2019', '', '<p class=MsoNormal style=\'margin-bottom:7.5pt;line-height:150%\'><span\r\nstyle=\'font-size:13.0pt;line-height:150%;font-family:\"Times New Roman\",serif\'>\r\nKhái quát về lịch sử phát triển, tóm tắt thành tích nổi bật của đơn vị thực\r\nhiện CTĐT (nêu tóm tắt các giai đoạn phát triển, tổng số ngành, chương trình,\r\n... quan hệ hợp tác, thành tích nổi bật).</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>Khoa Công nghệ thông tin được thành lập\r\nngày 05/07/1999 theo Quyết định số 115/TCHC của Hiệu trưởng Trường Cao Đẳng\r\nCông nghiệp Hà Nội. Khi đó, Khoa có chức năng đào tạo cho bậc trình độ Trung\r\ncấp và Cao đẳng.&nbsp;Sau khi có quyết định 315/2005 QĐ/TTG ngày 2/12/2005 của\r\nThủ tướng Chính phủ về việc thành lập Trường Đại học Công nghiệp Hà Nội trên cơ\r\nsở Trường Cao đẳng Công nghiệp Hà Nội, từ đây Khoa CNTT có thêm chức năng đào tạo\r\nbậc đại học.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>Là một đơn vị trực thuộc trường ĐHCN HN,\r\nKhoa CNTT có chức năng đào tạo và cung cấp dịch vụ chất lượng cao; nghiên cứu, ứng\r\ndụng và chuyển giao công nghệ liên quan đến lĩnh vực Máy tính và Công nghệ\r\nthông tin; có chức năng quản lý hành chính, quản lý công tác giảng dạy trong\r\nKhoa nhằm đáp ứng chương trình, kế hoạch giảng dạy chung của Nhà trường; thực\r\nhiện các chức năng theo quy định tại Điều lệ Trường Đại học ban hành kèm theo\r\nQĐ số 58/2010/QĐ-TTg ngày 22/9/2010 của Thủ tướng Chính phủ và Quy chế tổ chức,\r\nhoạt động của nhà trường.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><b><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>+Sứ mạng</span></b></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>Đào tạo, nghiên cứu khoa học, tư vấn, ứng\r\ndụng và chuyển giao công nghệ trong lĩnh vực Máy tính và CNTT.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><b><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>+ Tầm nhìn</span></b></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-indent:.5in;line-height:150%\'><span\r\nstyle=\'font-size:13.0pt;line-height:150%;font-family:\"Times New Roman\",serif\'>Là\r\nđịa chỉ tin cậy cung cấp nguồn nhân lực chất lượng cao cho thị trường lao động\r\nCNTT trong nước và quốc tế. Các chương trình đào tạo đạt chuẩn quốc gia và một\r\nsố ngành đạt chuẩn quốc tế;&nbsp;Là trung tâm nghiên cứu ứng dụng, chuyển giao\r\ncông nghệ uy tín trong lĩnh vực CNTT.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-indent:.5in;line-height:150%\'><b><span\r\nstyle=\'font-size:13.0pt;line-height:150%;font-family:\"Times New Roman\",serif\'>+Triết\r\nlý giáo dục</span></b></p>\r\n\r\n<p class=MsoNormal style=\'margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:\r\n150%;font-family:\"Times New Roman\",serif\'>Thực học, thực hành, thực danh, thực\r\nnghiệp</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-indent:35.45pt;line-height:\r\n150%\'><b><span style=\'font-size:13.0pt;line-height:150%;font-family:\"Times New Roman\",serif\'>+\r\nHoạt động đào tạo<br>\r\n</span></b><span style=\'font-size:13.0pt;line-height:150%;font-family:\"Times New Roman\",serif\'>Hiện\r\nnay, Khoa CNTT đảm nhiệm 1 ngành đào tạo trình độ Thạc sỹ; 4 ngành đào tạo\r\ntrình độ Đại học (gồm: Công nghệ thông tin; Khoa học máy tính; Hệ thống thông\r\ntin; Kỹ thuật phần mềm). Với tổng số học viên và sinh viên đang theo học tại\r\nkhoa: gần 4000 người.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><b><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>+ Hoạt động nghiên cứu khoa học</span></b></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Tổ chức thường niên hoạt động nghiên cứu\r\nkhoa học các cấp;</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Kể từ 2015 đến nay, cán bộ, giảng viên của\r\nKhoa có 95 bài báo đăng trên các tạp chí chuyên ngành trong và ngoài nước, kỷ yếu\r\nhội thảo quốc gia và quốc tế, nhiều bài được công bố trong các tạp chí có uy\r\ntín, 38 sách giáo trình, 12 hợp đồng chuyển giao sản phẩm CNTT.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Nhiều cán bộ, giảng viên là chủ nhiệm/tham\r\ngia công trình nghiên cứu khoa học cấp Nhà nước, cấp Bộ và cấp cơ sở đạt kết quả\r\ncao.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Bên cạnh hoạt động NCKH của giảng viên,\r\nsinh viên tích cực tham gia hoạt động nghiên cứu khoa học cấp khoa, cấp trường,\r\ncấp thành phố và đạt được nhiều kết quả đáng khích lệ, chất lượng các đề tài\r\nNCKH ngày càng được nâng lên cả về nội dung, hình thức và phương pháp nghiên cứu.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-top:0in;margin-right:0in;margin-bottom:0in;\r\nmargin-left:35.45pt;line-height:150%\'><b><span style=\'font-size:13.0pt;\r\nline-height:150%;font-family:\"Times New Roman\",serif\'>+ Giảng viên<br>\r\n</span></b><span style=\'font-size:13.0pt;line-height:150%;font-family:\"Times New Roman\",serif\'>-\r\nTỷ lệ giảng viên trình độ tiến sĩ trên tổng số giảng viên cơ hữu đạt 28%\r\n(15/54)</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Giảng viên chú trọng đổi mới phương pháp\r\ngiảng dạy, áp dụng các phương pháp giảng dạy tích cực, phát huy tính chủ động của\r\nngười học;</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Nhiều giảng viên thi giảng viên dạy giỏi\r\ncác cấp đạt thành tích cao như 01 giải nhất quốc gia, 02 giải nhì quốc gia, 02\r\ngiải nhì thành phố…</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- 100% giảng viên thực giảng đi tham quan,\r\ntìm hiểu thực tế tại các doanh nghiệp, từ đó, chuyển tải kiến thức thực tế\r\ntrong quá trình giảng dạy;</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- 100% giảng viên thực giảng báo cáo\r\nchuyên đề khoa học tại đơn vị, giúp giảng viên nâng cao năng lực chuyên môn và\r\nnăng lực nghiên cứu khoa học.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><b><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>+ Sinh viên và hoạt động ngoại khóa</span></b></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Tỷ lệ sinh viên có việc làm sau tốt nghiệp\r\ncao, có việc làm sau ngay khi tốt nghiệp là 76.7%&nbsp; và sau 6 tháng đạt\r\n95.3%.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Ngoài hoạt động học tập và nghiên cứu\r\nkhoa học, sinh viên còn được tham gia nhiều hoạt động ngoại khóa như: Tình Thầy\r\nTrò, IT Festival. Hay các hoạt động thiện nguyện như: đền ơn đáp nghĩa, uống nước\r\nnhớ nguồn, hiến máu nhân đạo, tiếp sức mùa thi, Tết ấm yêu thương...</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>+ Quỹ “Khuyến học khoa CNTT” do tập thể\r\nCB-GV, sinh viên và doanh nghiệp xây dựng nhằm động viên các tấm gương sáng\r\ntrong học tập, rèn luyện, hỗ trợ sinh viên có hoàn cảnh khó khăn nhưng vẫn vươn\r\nlên trong học tập.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-indent:35.45pt;line-height:\r\n150%\'><b><span style=\'font-size:13.0pt;line-height:150%;font-family:\"Times New Roman\",serif\'>+\r\nĐịnh hướng chiến lược</span></b></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>Nâng cao chất lượng đội ngũ CB-GV, đổi mới\r\nchương trình đào tạo theo hướng ứng dụng và phương pháp đào tạo theo hướng tích\r\ncực nhằm đáp ứng yêu cầu ngày càng cao của xã hội và xu thế hội nhập kinh tế quốc\r\ntế. Xây dựng và vận hành các CTĐT theo chuẩn của khu vực và quốc tế;</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><b><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>+ Quan điểm phát triển</span></b></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Phát triển hoạt động đào tạo và nghiên cứu\r\nkhoa học của Khoa CNTT trong khuôn khổ tầm nhìn sứ mạng và mục tiêu phát triển\r\ncủa Trường ĐHCN HN;</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Chất lượng đội ngũ cán bộ giảng viên là\r\nđiều kiện tiên quyết cho sự phát triển;</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Đào tạo và nghiên cứu khoa học theo hướng\r\nứng dụng, đáp ứng nhu cầu của xã hội và hội nhập kinh tế quốc tế.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:7.5pt;line-height:150%\'><span\r\nstyle=\'font-size:13.0pt;line-height:150%;font-family:\"Times New Roman\",serif\'>            <b>+\r\nThành tích nổi bật</b></span></p>\r\n\r\n<p style=\'margin:0in;text-align:justify;text-indent:28.35pt;line-height:150%;\r\nbackground:white\'><i><span style=\'font-size:13.0pt;line-height:150%;color:black\'>   </span></i><strong><i><span\r\nstyle=\'font-size:13.0pt;line-height:150%;color:black\'>(i). Đào tạo:</span></i></strong></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Giải nhất Tài năng sư phạm trẻ năm 2006</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Nhất toàn quốc (2009), Nhì toàn quốc\r\n(2002), giải Ba toàn quốc (2012), Nhất thành phố (2008), Nhì thành phố (2003,\r\n2004, 2008, 2012, 2014), ngoài ra còn nhiều giải Nhất, Nhì, Ba cấp trường cho\r\ncác hoạt động thi giáo viên giỏi nghiệp vụ sư phạm các năm</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Giấy khen cho nhóm giáo viên khoa CNTT\r\nhướng dẫn sinh viên tại Hội thi Olympic Tin học toàn quốc</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Công đoàn Công thương tặng bằng khen\r\n(2009, 2011).</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- 04 thầy, cô được nhận bằng Khen cấp Bộ\r\n2015.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n.5in;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- 01 bằng Khen của Thủ tướng chính phủ cho\r\ncá nhân 2015</span></p>\r\n\r\n<p style=\'margin:0in;text-align:justify;text-indent:28.35pt;line-height:150%;\r\nbackground:white\'><strong><i><span style=\'font-size:13.0pt;line-height:150%;\r\ncolor:black\'>(ii). NCKH</span></i></strong></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Giải nhất Olympic chuyên tin 2020</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Tổ chức thường niên hoạt động nghiên cứu\r\nkhoa học các cấp;</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Kể từ 2015 đến nay, cán bộ, giảng viên của\r\nKhoa có 95 bài báo đăng trên các tạp chí chuyên ngành trong và ngoài nước, kỷ yếu\r\nhội thảo quốc gia và quốc tế, nhiều bài được công bố trong các tạp chí có uy\r\ntín, 38 sách giáo trình, 12 hợp đồng chuyển giao sản phẩm CNTT.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Nhiều cán bộ, giảng viên là chủ nhiệm/tham\r\ngia công trình nghiên cứu khoa học cấp Nhà nước, cấp Bộ và cấp cơ sở đạt kết quả\r\ncao.</span></p>\r\n\r\n<p style=\'margin:0in;text-align:justify;text-indent:28.35pt;line-height:150%;\r\nbackground:white\'><strong><i><span style=\'font-size:13.0pt;line-height:150%;\r\ncolor:black\'>(iii). Phong trào văn hóa – văn nghệ, thể thao</span></i></strong></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Văn nghệ: giải Nhất các năm 2003, 2006;\r\ngiải Nhì các năm 2002, 2005, 2007; giải Ba năm 2011</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Giải Nhì tại hội&nbsp; thi chào mừng 99\r\nnăm ngày Quốc tế Phụ nữ 20.10 năm 2020.</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Ngoài ra, CBVC Khoa CNTT còn được nhiều\r\ngiải nhất, nhì, ba cho các hoạt động văn hóa, nghệ thuật hàng năm khác như:\r\nbóng chuyền, bóng đá, cầu lông</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:7.5pt;line-height:150%\'><i><span\r\nstyle=\'font-size:13.0pt;line-height:150%;font-family:\"Times New Roman\",serif\'>            (iv)\r\nPhong trào Đoàn thanh niên, Hội sinh viên</span></i></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Giải Khuyến khích &quot; Thử thách sáng\r\ntạo cùng Samsung 2015&quot; </span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Giải Á khôi 1 cuộc thi &quot;Nữ sinh\r\nthanh lịch&quot; vào tháng 12/2016</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- Quán&nbsp;quân (giải Nhất) - &quot;The\r\nVoice HaUI&quot;  năm 2019</span></p>\r\n\r\n<p class=MsoNormal style=\'margin-bottom:0in;text-align:justify;text-indent:\r\n35.45pt;line-height:150%\'><span style=\'font-size:13.0pt;line-height:150%;\r\nfont-family:\"Times New Roman\",serif\'>- 27 Bằng khen của BCH Đoàn Thanh niên Cộng\r\nsản Hồ Chí Minh , BCH TW Hội sinh viên VN, BCH Hội sinh viên TP Hà Nội như: Bằng\r\nkhen của BCH Hội sinh viên Việt Nam nhiệm kỳ 2012 – 2014, Bằng khen của BCH\r\nĐoàn Thanh niên Cộng sản Hồ Chí Minh TP Hà Nội các năm, 2005, 2016, 2017,..</span></p>', '<p class=MsoNormal style=\'margin-bottom:7.5pt;line-height:150%\'><span\r\nstyle=\'font-size:13.0pt;line-height:150%;font-family:\"Times New Roman\",serif\'>\r\nCơ cấu tổ chức hành chính của cơ sở giáo dục và đơn vị thực hiện CTĐT</span></p>\r\n\r\n<p class=MsoNormal>\r\n<img width=623 height=331 id=\"Picture 8\" src=\"data:image/png;base64,\"></p>\r\n');
