INSERT INTO `donvi` (`id`, `ten_donvi`, `loai_dv_id`, `dvcc`, `lvhd`, `lhcsgd`, `ten_ngan`, `ma_donvi`, `dia_chi`, `mo_ta`, `truong_dv`, `canbo_dbcl`, `nguoi_tao`, `csdt_id`, `trang_thai`, `created_at`, `updated_at`, `deleted_at`, `ten_tienganh`, `ten_donvi_cu`, `ten_ctdt`, `ten_ctdt_tienganh`, `ten_ctdt_cu`, `ma_ctdt`, `dien_thoai`, `email`, `website`, `nam_thanhlap`, `nam_batdau`, `nam_capbang`, `mota_nam_thanhlap`, `gioi_thieu`, `co_cau_tochuc`) VALUES
(14, 'Khoa Kế toán Kiểm toán', 1, NULL, NULL, NULL, 'KT & KT', '1014', 'Tầng 1 - Nhà B1 - CS2', 'Hội trường B1', 3333, 3399, 0, 1, 'active', NULL, '2021-03-22 07:41:37', NULL, 'Department Auditing', 'Khoa Kinh tế', 'Cử nhân Kiểm toán', 'Auditing', NULL, '7340302', NULL, 'khoakt@haui.edu.vn ', 'https://faa.haui.edu.vn/vn ', '2010', '2015', '2019', NULL, '<p>&nbsp; &nbsp; &nbsp; Tiền thân của Khoa KT-KT là Trường Nghiệp vụ Kinh tế trực thuộc Bộ Công nghiệp nặng, thành lập năm 1958, đặt tại Chèm – xã Đông Ngạc - huyện Từ Liêm - TP.Hà Nội.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; Giai đoạn từ năm 1962 đến năm 1980: Là Trường Trung học Kinh tế I- Bộ Cơ khí và Luyện kim, đặt tại điểm xã Cải Đan, huyện Phổ Yên,tỉnh Thái Nguyên</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; Giai đoạn từ năm 1980 đến 2009: Trường Trung học Kinh tế I sát nhập với trường Trung học Cơ khí I, Bộ Cơ khí và Luyện Kim và trở thành Khoa Kinh tế của Trường ĐHCNHN.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; Ngày 04 tháng 01 năm 2010 Hiệu trưởng trường ĐHCNHN ra quyết định thành lập khoa KT-KT trên cơ sở tách từ khoa Kinh tế thành hai khoa KT-KT và Quản lý kinh doanh.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;Hơn nửa thế kỷ qua, Khoa Kế toán-Kiểm toán đã đào tạo và cung cấp hàng vạn SV ngành Kế toán, kiểm toán cho các cơ quan, DN ở tất cả các ngành, các lĩnh vực trong cả nước. Nhiều SV ra trường đã và đang giữ chức vụ lãnh đạo, quản\r\n    lý ở các DN, cơ quan hành, cơ quan quản lý NN.\r\n</p>\r\n<p><br></p>', '<p style=\"text-align: center;\"><img src=\"data:image/png;base64,\"\r\n        alt=\"\"><br></p>\r\n<p>\r\n    <p style=\"text-align: center;\">CƠ CẤU TỔ CHỨC TRƯỜNG ĐHCNHN<span lang=\"PT-BR\"></span></p>\r\n\r\n    <p style=\"text-align: center;\">CƠ CẤU TỔ CHỨC KHOA KẾ TOÁN – KIỂM TOÁN<span lang=\"PT-BR\"></span></p>\r\n    <p style=\"text-align: center;\"><img src=\"data:image/png;base64,\"\r\n            alt=\"\"><br></p><br></p>');
