INSERT INTO `donvi` (`id`, `ten_donvi`, `loai_dv_id`, `dvcc`, `lvhd`, `lhcsgd`, `ten_ngan`, `ma_donvi`, `dia_chi`, `mo_ta`, `truong_dv`, `canbo_dbcl`, `nguoi_tao`, `csdt_id`, `trang_thai`, `created_at`, `updated_at`, `deleted_at`, `ten_tienganh`, `ten_donvi_cu`, `ten_ctdt`, `ten_ctdt_tienganh`, `ten_ctdt_cu`, `ma_ctdt`, `dien_thoai`, `email`, `website`, `nam_thanhlap`, `nam_batdau`, `nam_capbang`, `mota_nam_thanhlap`, `gioi_thieu`, `co_cau_tochuc`) VALUES
(17, 'Khoa Ngoại ngữ', 1, NULL, NULL, NULL, 'Ngoại ngữ', '1017', 'Tầng 3, Tòa A2, Trường ĐH Công nghiệp Hà Nội, Số 298 đường Cầu Diễn, Bắc Từ Liêm, Hà Nội', '', 3536, 3540, 0, 1, 'active', NULL, '2021-03-22 07:40:35', NULL, 'Faculty of Foreign Languages', NULL, 'Ngôn ngữ Anh', 'English Linguistics', NULL, 'DH2202011', '043765512', 'khoann@haui.edu.vn', NULL, '2005', '2006', '2010', NULL, '<p style=\'margin-top:0in;margin-right:0in;margin-bottom:.0001pt;margin-left:0in;line-height:150%;font-size:15px;font-family:\"Calibri\",\"sans-serif\";text-align:justify;\'><span style=\'font-size:17px;line-height:150%;font-family:\"Times New Roman\",\"serif\";\'>Kh&aacute;i qu&aacute;t về lịch sử ph&aacute;t triển, t&oacute;m tắt th&agrave;nh t&iacute;ch nổi bật của đơn vị thực hiện CTĐT (n&ecirc;u t&oacute;m tắt c&aacute;c giai đoạn ph&aacute;t triển, tổng số ng&agrave;nh, chương tr&igrave;nh, ... quan hệ hợp t&aacute;c, th&agrave;nh t&iacute;ch nổi bật).</span></p>\r\n<p><span style=\'font-size:17px;line-height:107%;font-family:\"Times New Roman\",\"serif\";\'>KNN - Trường ĐHCNHN được th&agrave;nh l&acirc;̣p ngày 22/12/2005 theo quy&ecirc;́t định của Hi&ecirc;̣u trưởng Trường Đại học C&ocirc;ng nghi&ecirc;̣p Hà N&ocirc;̣i tr&ecirc;n cơ sở hợp nhất Ban ngoại ngữ v&agrave; Tổ Ngoại ngữ đ&agrave;o tạo hợp t&aacute;c quốc tế. Cho đến nay, KNN đang l&agrave; một trong những đơn vị ti&ecirc;n phong trong c&ocirc;ng cuộc đ&agrave;o tạo c&aacute;c chuy&ecirc;n ng&agrave;nh như: NN Anh, NN H&agrave;n Quốc, NN Trung Quốc, NN Nhật Bản, Tiếng Việt v&agrave; Văn H&oacute;a Việt Nam, đảm bảo cung ứng nh&acirc;n lực cho nhiều ng&agrave;nh nghề kh&aacute;c nhau trong x&atilde; hội như: bi&ecirc;n phi&ecirc;n dịch, giảng dạy, hướng dẫn vi&ecirc;n du lịch, nh&acirc;n vi&ecirc;n c&aacute;c cơ sở. Trong suốt 5 năm ph&aacute;t triển (2015-2020), tổng số SV đ&agrave;o tạo l&ecirc;n đến 1026 SV trong ng&agrave;nh NNA, đạt tỷ lệ 90%- 95% c&oacute; việc l&agrave;m sau khi tốt nghiệp. Hiện nay, số SV đang học tập tại khoa l&ecirc;n tới 1152 SV bao gồm cả c&aacute;c học vi&ecirc;n cao học. Với chương tr&igrave;nh đ&agrave;o tạo lu&ocirc;n được cập nhật, đổi mới c&ugrave;ng những nội dung được thiết kế đa dạng, phong ph&uacute;, hấp dẫn người học, KNN lu&ocirc;n tự h&agrave;o với một CTĐT b&aacute;m s&aacute;t CĐR theo định hướng ứng dụng. Th&ecirc;m v&agrave;o đ&oacute;, KNN cũng thường xuy&ecirc;n tổ chức c&aacute;c buổi hội thảo, bồi dưỡng năng lực giảng vi&ecirc;n với những chuy&ecirc;n gia đến từ c&aacute;c trường trong v&agrave; ngo&agrave;i nước. Song song với việc đ&agrave;o tạo trong nước, KNN cũng đ&atilde; c&oacute; li&ecirc;n kết đ&agrave;o tạo c&ugrave;ng nhiều trường quốc tế kh&aacute;c tại Trung Quốc v&agrave; c&aacute;c chương tr&igrave;nh giao lưu với c&aacute;c trường ở H&agrave;n Quốc. Những sự kiện lớn được KNN mở ra hằng năm như l&agrave; một s&acirc;n chơi bổ &iacute;ch cho c&aacute;c bạn SV trao đổi, giao lưu văn h&oacute;a, tăng cường vốn trải nghiệm thực tiễn như: lễ hội Halloween, FLL&rsquo;s got talent, Giao lưu văn h&oacute;a c&ugrave;ng lưu học sinh Trung Quốc, H&agrave;n Quốc, Nhật Bản. C&oacute; thể n&oacute;i, với những thuận lợi như đ&atilde; kể tr&ecirc;n, KNN đang dần ho&agrave;n thiện m&igrave;nh hơn, nỗ lực hết m&igrave;nh để từng bước đưa việc GD&amp;ĐT trở n&ecirc;n vững mạnh hơn, xứng tầm với c&aacute;c nước trong v&agrave; ngo&agrave;i nước, l&agrave; nơi để c&aacute;c bạn SV lu&ocirc;n tin tưởng khi lựa chọn ng&agrave;nh nghề cho tương lai.&nbsp;</span></p>', '<p>Cơ cấu tổ chức hành chính của cơ sở giáo dục và đơn vị thực hiện CTĐT (vẽ sơ đồ\r\nriêng).</p>\r\n\r\n<p class=MsoNormal><span style=\'font-size:12.0pt;line-height:107%;font-family:\r\n\"Times New Roman\",serif\'>\r\n<img border=0 width=624 height=713 id=\"Picture 6\" src=\"data:image/jpeg;base64,\" alt=\"Cơ cấu tổ chức\"></span>\r\n</p>');
INSERT INTO `donvi` (`id`, `ten_donvi`, `loai_dv_id`, `dvcc`, `lvhd`, `lhcsgd`, `ten_ngan`, `ma_donvi`, `dia_chi`, `mo_ta`, `truong_dv`, `canbo_dbcl`, `nguoi_tao`, `csdt_id`, `trang_thai`, `created_at`, `updated_at`, `deleted_at`, `ten_tienganh`, `ten_donvi_cu`, `ten_ctdt`, `ten_ctdt_tienganh`, `ten_ctdt_cu`, `ma_ctdt`, `dien_thoai`, `email`, `website`, `nam_thanhlap`, `nam_batdau`, `nam_capbang`, `mota_nam_thanhlap`, `gioi_thieu`, `co_cau_tochuc`) VALUES
(18, 'Khoa Quản lý kinh doanh', 1, NULL, NULL, NULL, 'QLKD', '1018', 'Tầng 7 - Nhà A10 - Cơ sở 1 - Trường Đại học Công nghiệp Hà Nội (Số 298 đường Cầu Diễn, quận Bắc Từ Liêm, Hà Nội).', 'Hội trường B3', 3440, 0, 0, 1, 'active', NULL, '2021-10-01 08:38:11', NULL, 'Business Management Faculty', NULL, 'Cử nhân TCNH', 'Bank financial Bachelors', NULL, '52340201', '0985699369', 'khoaqlkd@haui.edu.vn', 'https://fbm.haui.edu.vn/vn', '2010', '2009', '2013', '(Quyết định số 02/2010/QĐ-ĐHCN ngày 04 tháng 01 năm 2010 của Hiệu trưởng Trường Đại học Công nghiệp Hà Nội về việc thành lập Khoa QLKD).', '<p>(nêu tóm tắt các giai đoạn phát triển, tổng số ngành, chương trình,... quan hệ hợp tác, thành tích nổi bật).</p>\n\n<p><b><i>1. Lịch sử hình thành và phát triển</i></b><i></i></p>\n\n<p>Trước nhu cầu phát triển của thị trường lao động, và yêu cầu cho một giai đoạn phát triển hoạt động đào tạo tại trường Đại học Công nghiệp Hà Nội. Ngày 04/01/2010, Nhà trường quyết định thành lập khoa QLKD trên cơ sở chia tách khoa Kinh tế.</p>\n\n<p>Khi thành lập Khoa QLKD từ chỗ chỉ 60 GV, với 2 ngành đào tạo. Nhưng với nỗi lực của từng thành viên trong khoa và sự chỉ đạo của Đảng Ủy, Ban giám hiệu; Từ đó đến nay, Khoa QLKD liên tục phát triển (về chất lượng đỗi ngũ GV, CTĐT; 25% GV có trình độ\n    Tiến sĩ, đào tạo 1 ngành trình độ Cao học, 6 ngành trình độ Đại học) và đạt được nhiều thành tích cao trong giảng dạy, NCKH, văn hóa - văn nghệ - thể thao, từ thiện, phát triển cộng đồng…\n</p>\n\n<p><b><i>2. Chức năng, nhiệm vụ của khoa QLKD</i></b><i></i></p>\n\n<p><i>2.1. Chức năng</i><b></b></p>\n\n<p>Khoa QLKD là đơn vị trực thuộc trường Đại học Công nghiệp Hà Nội, có chức năng đào tạo và cung cấp dịch vụ chất lượng cao; nghiên cứu, ứng dụng và chuyển giao công nghệ liên quan đến lĩnh vực QLKD; có chức năng quản lý hành chính, quản lý công tác giảng\n    dạy trong Khoa nhằm đáp ứng chương trình, kế hoạch giảng dạy chung của Nhà trường; thực hiện các chức năng theo quy định tại Điều lệ Trường Đại học ban hành kèm theo QĐ số 58/2010/QĐ-TTg ngày 22/9/2010 của Thủ tướng Chính phủ và Quy chế tổ chức, hoạt\n    động của nhà trường.</p>\n\n<p><i>2.2. Một số nhiệm vụ chủ\nyếu</i><b></b></p>\n\n<p>- Xây dựng, trình Hiệu trưởng phê duyệt và tổ chức thực hiện kế hoạch phát triển toàn diện Khoa theo hướng phát triển của Trường và từng bước nâng cao chất lượng.</p>\n\n<p>- Đăng ký nhận nhiệm vụ đào tạo các cấp trình độ, mở ngành, chuyên ngành đào tạo; Xây dựng CTĐT, kế hoạch giảng dạy, học tập và chủ trì tổ chức quá trình đào tạo một hoặc một số ngành trong lĩnh vực QLKD; quản lý nội dung, phương pháp, chất lượng đào\n    tạo do Nhà trường giao;\n</p>\n\n<p>- Đề xuất Hiệu trưởng xét chọn và tổ chức biên soạn giáo trình môn học phục vụ đào tạo; tổ chức nghiên cứu cải tiến phương pháp giảng dạy, học tập;</p>\n\n<p>- Đề xuất Hiệu trưởng xét chọn và chủ động xây dựng mối quan hệ, khai thác và phối hợp với các tổ chức khoa học và công nghệ, các doanh nghiệp trong và ngoài nước, gắn đào tạo với NCKH, với sản xuất kinh doanh và đời sống xã hội nhằm tăng cường năng lực\n    giảng dạy, NCKH cho GV; QLCL hoạt động khoa học và công nghệ do Nhà trường giao;</p>\n\n<p>- Quản lý công chức, viên chức và người học thuộc khoa theo phân cấp của Hiệu trưởng; tổ chức đào tạo, bồi dưỡng nâng cao trình độ chuyên môn, nghiệp vụ cho GV và cán bộ nhân viên thuộc khoa; xây dựng kế hoạch phát triển đội ngũ GV trong Khoa theo định\n    hướng của Nhà trường; đề xuất với Hiệu trưởng thay đổi về tổ chức, nhân sự trong khoa; tổ chức đánh giá cán bộ quản lý, GV và nghiên cứu viên trong Khoa theo quy định của Nhà trường;</p>\n\n<p><b><i>3. Thành tích từ năm 2010 đến 11/2020</i></b><i></i></p>\n\n<p><i>(i). Giảng dạy:</i><b></b></p>\n\n<p>- 2 Giải Nhì giáo viên dạy giỏi cấp Quốc gia;</p>\n\n<p>- 4 Giải Nhất giáo viên dạy giỏi cấp Thành phố</p>\n\n<p>- 2 Giải Nhất giáo viên dạy giỏi cấp Trường\n</p>\n\n<p><i>(ii). NCKH</i><b></b></p>\n\n<p>- Tổ chức thành công Hội thảo khoa học Quốc gia - lần 4 (2019) \"Cách mạng công nghiệp lần thứ tư: Khởi nghiệp và phát triển doanh nghiệp Việt Nam\"</p>\n\n<p>- Tổ chức thành công Hội thảo khoa học Quốc gia - lần 3 (2018) \"Cùng doanh nghiệp hướng tới phát triển bền vững\"</p>\n\n<p>- Tổ chức thành công Hội thảo khoa học Quốc gia - lần 2 (2016) “<i>Đào tạo ngành QTKD và ngành TCNH lý thuyết gắn\nvới thực tiễn</i>”.</p>\n\n<p>- Tổ chức thành công Hội thảo khoa học Quốc gia - lần 1 (2014): \"Phương pháp dạy học hiệu quả đối với ngành QTKD và TCNH\".</p>\n\n<p>- Nghiệm thu 17 đề tài, đề án cấp trường đạt kết quả xuất sắc, và tham gia nhiều đề tài cấp Bộ.</p>\n\n<p>- Biên soạn, in, và phát hành thông qua các Nhà xuất bản 35 giáo trình.</p>\n\n<p>- Hơn 1.000 bài báo khoa học được đăng trên các tạp chí trong nước và nước ngoài, kỷ yếu hội thảo quốc gia và quốc tế.</p>\n\n<p><i>(iii). Phong trào văn\nhóa – văn nghệ, thể thao:</i><b></b></p>\n\n<p>- Giải Xuất sắc tập thể \"<i>Hội diễn văn nghệ quần chúng CBVC năm 2018, Chào\nmừng kỷ niệm 120 năm ngày truyền thống Nhà trường</i>\";</p>\n\n<p>- Giải Nhì toàn đoàn \"<i>Hội diễn văn nghệ quần chúng trường ĐHCNHN năm\n2015</i>\";</p>\n\n<p>- Giải Xuất sắc toàn đoàn \"<i>Hội diễn văn nghệ quần chúng trường ĐHCNHN năm\n2013</i>\";</p>\n\n<p>- Giải Nhì “<i>Giải bóng đá cán bộ công nhân viên chức ĐHCNHN\nnăm 2013</i>”;</p>\n<p><br></p>', '<p style=\"text-align: center;\"><img src=\"data:image/png;base64,\"\n        alt=\"\"><br></p>');
